import './App.css';
import img1 from "portofoliomagda\public\WhatsApp Image 2024-02-19 at 20.22.48.jpeg"// with import
import {Parallax,ParallaxLayer} from '@react-spring/parallax'

function App() {
  return (

          <div className='z-10 flex items-center justify-center h-screen'>
            <h1 className=" font-CormorantGaramond text-[200px] text-slate-700">Magda Nemes</h1>
              <Overlay></Overlay>
           </div>

  );
  function Overlay(){
    <div className='z-20'>
          <img src={img1} alt="painting"></img>

    </div>
  }
}

export default App;
